import React from "react";
import { Link } from "react-router-dom";

const Nav = () => {
  return (
    <nav className="#4db6ac teal lighten-2">
      <ul class="row">
        <Link to="/">
          <li class="col s12 m4 l4 center">All</li>
        </Link>
        <Link to="/process">
          <li class="col s12 m4 l4 center">Processing</li>
        </Link>
        <Link to="/done">
          <li class="col s12 m4 l4 center">Done</li>
        </Link>
      </ul>
    </nav>
  );
};

export default Nav;
